import React from "react";
import { BrowserRouter as Router, Route, withRouter } from "react-router-dom";
import Hypertension from '../hypertension/Hypertension';
import KidneyDisease from '../kidneyDisease/KidneyDisease';
import MenuContainer from "./menu";

function AppRouter() {
  return (
      <div>
        <Route path="/" exact component={MenuContainer} />
        <Route path="/home" component={MenuContainer} />
        <Route path="/hypertension/" component={Hypertension} />
        <Route path="/kidneydisease/" component={KidneyDisease} />
      </div>
  );
}

export default withRouter(AppRouter);
